INSERT INTO `chatter_post` VALUES (1,1,1,'<p>No dancer social space would be complete without forums! So here it is! Forums for you all your all dance, step, music etc. discussion needs!</p>\n<p>Like always - this section is heavily under construction, but feel free to leave a message here</p>','2018-08-21 11:43:37','2019-10-01 03:59:47',0,0,NULL),(2,1,1,'<p>Testing a reply</p>','2018-08-21 11:45:56','2018-08-21 11:45:56',0,0,NULL),(3,2,1,'<p>This post was created from dance screen just to check if it works. And, if you are reading this, then know - the tests were successful</p>','2018-08-22 08:27:15','2018-08-22 08:27:15',0,0,NULL),(4,3,1,'<p><img src=\"https://i.pinimg.com/564x/8f/35/d8/8f35d8af44aa9c15c9641abe7509def1.jpg\" alt=\"\" width=\"268\" height=\"268\" />Once I heard Peter Loggins say that if we dress to fashion and listen to music from past, then we are not dancers of our own life. We become reenactors.</p>\n<p>I remember when I started Lindy Hopping two and a half years ago, everyone used to dress up for all Swing Dance parties. No exceptions. It played it\'s role of me falling in love with Lindy hop. Nowdays people don\'t bother and I miss the old days from two years ago.</p>\n<p>What do you think? Is casual style ok?</p>','2018-08-22 12:58:22','2018-08-22 13:02:25',0,0,'2018-08-22 13:02:25'),(5,4,1,'Once I heard Peter Loggins say that if we dress to fashion and listen to music from past, then we are not dancers of our own life. We become reenactors.\r\nI remember when I started Lindy Hopping two and a half years ago, everyone used to dress up for all Swing Dance parties. No exceptions. It played it\'s role of me falling in love with Lindy hop. Nowdays people don\'t bother and I miss the old days from two years ago.\r\nWhat do you think? Is modern casual style ok?','2018-08-22 13:01:12','2023-09-02 04:59:28',0,0,NULL),(6,1,1,'<p>Testing&nbsp;discussion reply traits</p>','2018-08-31 08:53:02','2018-08-31 08:53:02',0,0,NULL),(8,6,203,'CKG Sand Scoop For