,NULL),(17,'2017-12-14 16:17:59','2017-12-14 16:17:59','int/adv izlaidums 2017w',3,'',1,'',1,NULL),(18,'2018-08-26 10:59:50','2018-08-26 10:59:50','Cut it',17,NULL,1,'Sherrie Silver',1,1),(19,'2018-08-26 11:23:27','2018-08-29 08:28:08','This is America',17,'Original choreography by Sherrie Silver for Childish Gambino music video This is America.',2,'Sherrie Silver',1,1),(20,'2018-09-25 17:20:34','2018-09-25 17:20:34','Caribbean shim sham',4,NULL,2,'Remy Kouakou Kouame',1,1),(21,'2019-09-11 05:19:03','2019-09-11 05:19:03','Shim Sham',22,'The Shim Sham Shimmy or Shim Sham originally is a particular tap dance routine and is regarded as tap dance\'s national anthem. For swing dancers, today it is a kind of line dance that recalls the roots of swing.',1,NULL,1,1),(22,'2023-08-31 04:21:53','2023-08-31 04:33:33','Trickeration',4,'Norma Miller\'s Trickeration isn\'t just a dance routine – it\'s a testament to the power of passion, creativity, and the human spirit. It\'s a reminder that within each of us lies the potential to express ourselves in ways that transcend words, connecting us to something greater. So come, let the music move you, let Norma\'s Trickeration inspire you, and let the dance remind you of the magic that resides within.',3,'Norma Miller',1,1);
