INSERT INTO `dances` VALUES (5,'2017-03-28 22:51:22','2018-08-20 14:31:40',NULL,'Rueda de Casino','Grupveida deja, kas nav iestudēta. Ir standarta soļi jeb figūras, ar kuriem dejotājiem ir jābūt pazīstamiem. Viens no dejotājiem, saukts par \"kantoru\", sauc figūru, kas tiks dejota uzreiz pēc patreiz izpildāmās figūras beigām.<br>\r\nŠīs dejas laikā notiek bieža partneru maiņa un lielākā jautrība sākas, kad kādam kaut kas nojūk. Daļēji šo deju var uzskatīt par spēli, jo tanī ir komanda \"es pārdomāju\", ko kantors troļļojot izmanto, lai atceltu iepriekš nosaukto komandu. <br>\r\nŅemot vērā, ka soļi tiek saukti, deja ir pietiekami vienkārša, lai 5 vienkāršākos soļus iemācītu draugiem ballītes laikā un kopīgi uzspēlētu/uzdejotu šo deju.',NULL,1,1,2),(2,'2017-03-28 11:10:26','2018-08-20 14:31:07',NULL,'LA Salsa',NULL,NULL,1,1,2),(3,'2017-03-28 11:29:29','2018-08-20 14:31:24',NULL,'Lindy Hop','Линди хоп — танец абсолютно хулиганский. Возник в начале прошлого столетия в Америке сухого закона, Великой Депрессии и безудержных девушек-флаппер. Линди хоп — это драйв, игра, импровизация. Стоит один раз попробовать, чтобы понять — это навсегда!',NULL,1,1,1),(4,'2017-03-28 11:58:08','2018-08-20 14:32:42',NULL,'Solo Jazz','Solo Jazz is one of the fastest and most independent ways for you to grow as a dancer! It improves your ability to move with balance, rhythm, elegance and a rich repertoire of steps.',NULL,1,1,1),(6,'2017-04-23 18:38:36','2018-08-20 14:32:59',NULL,'St. Louis Shag','Nevari izlemt par labu kikiem vai triplestepiem? Dejo abus!',NULL,1,1,1),(7,'2017-04-24 06:55:53','2018-08-20 14:30:51',NULL,'Drag Blues','https://www.youtube.com/watch?v=9lFWWheBVuA',NULL,1,1,1),(8,'2017-04-26 07:54:34','2018-08-20 14:33:34',NULL,'Swing Rueda','In 2000, after extensive studying of Salsa in Miami, Jeff Miller and Elaine Hewlett began teaching the famed 1950\'s Cuban dance, Salsa Rueda in Dallas, Texas. Rueda is danced in a circle with two or more couples. There is a dancer who calls the moves which the entire circle executes in unison. Some moves require partner changes and that\'s when the fun begins.\r\nUsing the Cuban original as a template, Jeff and Elaine created Swing Rueda. Since its creation it has been spread around the country, with reports of it traveling as far as Sweden and Singapore.\r\nSome of the moves\' names are the same in both the Swing and Salsa versions of the dance. For example, Dame (which translates as give me) is used to get a new partner. Other names have changed slightly due to the largely non-Spanish speaking dancers in Swing. For example, Enchufayla became Chalupa. Other names are not related at all to the original Salsa version, such as Sushi or Amoeba.',NULL,1,1,1),(9,'2017-06-21 08:50:30','2018-08-20 14:31:54',NULL,'Slow Drag',NULL,NULL,1,1,1),(10,'2017-07-12 10:20:04','2019-09-11 06:14:16',NULL,'Swing Circle','Based on cuban Rueda de Casino, but performed in swing manner with 8count pattern',NULL,1,1,1),(11,'2017-11-14 21:27:16','2018-08-20 14:32:13',NULL,'Solo Blues',NULL,NULL,1,1,1),(15,'2018-08-20 11:09:30','2018-08-20 14:30:33',NULL,'Cuban Salsa','In Cuba, a popular dance known as Casino was marketed abroad as Cuban-style salsa or Salsa Cubana to distinguish it from other salsa styles when the name was popularized in the 1970s. Dancing Casino is an expression of popular social culture; Many Cubans consider casino a part of their social and cultural activities centering on their popular music.',NULL,1,1,2),(13,'2018-01-12 12:48:19','2018-08-20 14:35:07',NULL,'Slow Waltz',NULL,NULL,1,1,3),(14,'2018-07-16 09:40:24','2018-08-22 06:31:24',NULL,'Collegiate shag',NULL,NULL,1,NULL,1),(16,'2018-08-21 14:48:49','2018-08-21 14:48:49',NULL,'Bachata','Bachata is a style of social dance from the Dominican Republic which is now danced all over the world. It is associated with bachata music.',NULL,1,1,2),(17,'2018-08-26 10:52:58','2018-08-26 10:52:58',NULL,'Afrobeat',NULL,NULL,1,1,2),(18,'2018-08-26 21:43:53','2018-08-26 21:43:53',NULL,'Argentine Tango',NULL,NULL,1,1,NULL),(19,'2018-08-28 12:26:20','2018-08-28 12:26:20',NULL,'Shuffle',NULL,NULL,1,1,NULL),(20,'2019-03-14 10:33:28','2019-03-14 10:33:28',NULL,'Balboa','The Balboa is a swing dance that originated in Southern California during the 1920s and enjoyed huge popularity during the 1930s and 1940s. The term Balboa originally referred to a dance characterized by its close embrace and full body connection. It emphasizes rhythmic weight shifts and lead-follow partnership.',NULL,1,1,1),(21,'2019-04-09 08:16:48','2019-04-09 08:16:48',NULL,'Kizomba','Semba has been danced in the 1950s in Angola. In the 1990s, when the actual kizomba music got more and more popular, Angolan semba dancers started to adapt their semba steps according to the tempo and flavour of the Kizomba beats.[4] The Kizomba dance is a couple dance from which many styles such as, tarraxinha and Urban kiz derived from.',NULL,1,1,2),(22,'2019-09-11 05:10:10','2019-09-11 05:10:10',NULL,'Tap Dance','Tap dance is a type of dance characterized by using the sounds of tap shoes striking the floor as a form of percussion. The sound is made by shoes that have a metal \"tap\" on the heel and toe.',NULL,1,1,NULL);
/*!40000 ALTER TABLE `dances` ENABLE KEYS */;
UNLOCK TABLES;

