INSERT INTO `steps` VALUES (1,'2017-03-28 11:38:43','2017-03-28 11:38:43',NULL,'Mambo',2,'Pamatsolis',1,1,NULL),(2,'2017-03-28 11:58:34','2017-03-28 11:58:34',NULL,'Shim Sham',4,'',1,1,NULL),(3,'2017-03-28 11:59:18','2017-03-28 11:59:18',NULL,'Tacky Annie',4,'',1,1,NULL),(4,'2017-03-28 12:00:16','2017-03-29 08:15:02',NULL,'Apple Jacks',4,'<h3>Tips:</h3>\r\n<ul>\r\n<li>\r\nKeep your feet approximately parallel. Don’t go too pigeon toed or point your toes apart.\r\n</li>\r\n<li>\r\nSee how the knee of my leg that I’m NOT standing on is a little in front? It not only looks nice, it’s an easy and obvious position to put your leg in when you’re pivoting on the other foot.\r\n</li>\r\n<li>\r\nUse your core! Keep your head and shoulders pointed mostly forward, and let the spine and pelvis twist a little back and forth with your feet.\r\n</li>\r\n<li>\r\nBalance, balance, balance.\r\n</li>\r\n</ul>\r\nhttps://www.youtube.com/watch?v=ZbxSpX7U4jQ',1,1,NULL),(5,'2017-03-28 12:00:44','2017-04-11 18:36:09',NULL,'Fall of a Log',4,'',1,1,NULL),(6,'2017-03-28 12:02:43','2017-03-28 12:02:43',NULL,'Break',4,'',1,1,NULL),(7,'2017-03-28 12:03:02','2017-03-28 12:03:02',NULL,'Half Break',4,'',1,1,NULL),(8,'2017-03-28 12:03:21','2017-03-28 12:03:21',NULL,'Kick Ball Change',4,'',1,1,NULL),(9,'2017-03-28 12:04:10','2017-03-28 12:04:10',NULL,'Shorty George',4,'',1,1,NULL),(10,'2017-03-28 13:26:03','2017-03-28 13:26:03',NULL,'Rumba',2,'Citviet soli mēdz dēvēt \"La Cucaracha.\"',1,1,NULL),(11,'2017-03-28 20:58:07','2017-03-28 20:58:07',NULL,'6 count basic',3,'',1,1,NULL),(12,'2017-03-28 20:58:22','2017-03-28 20:58:22',NULL,'8 count basic',3,'',1,1,NULL),(13,'2017-03-28 20:58:56','2017-03-29 20:13:35',NULL,'Side Pass',3,'A.K.A. Augšējā vietu maiņa',1,1,NULL),(14,'2017-03-28 21:14:17','2017-11-05 21:09:35',NULL,'Under Arm',3,'https://www.youtube.com/watch?v=1BctgUMHgcc?start=38&end=48',1,1,NULL),(15,'2017-03-28 21:14:39','2017-03-28 21:14:39','0000-00-00 00:00:00','Tuck Turn',3,'',1,1,NULL),(16,